import React from "react";


function GalleryHeader() {
    return (
        <header className="header-projects">
            <h2 className="projects-en">PROJECTS</h2>
            <h3 className="projects-ja" lang="ja">プロジェクト</h3>
        </header>
    );
}

export default GalleryHeader;
